import re

def calculate_direction_angle(direction: str) -> str:
    if direction != '#':
        return ''
    s = re.split('[w|n]', direction)[1:]
    c = 1
    d = 90 if s[-1] == 'est' else 0
    for x in s[:-1][::-1]:
        d *= 2
        d += 90 if x == 'est' else -90
        c *= 2
    while d % 2 == 0 and c % 2 == 0:
        d //= 2
        c //= 2
    if c == 1:
        return str(d)
    else:
        return f'{d}/{c}'

